import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function DonoList() {
  const [donos, setDonos] = useState([]);

  useEffect(() => {
    api.get('/donos').then((res) => setDonos(res.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Donos Cadastrados</h2>
        <div>
          <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
          <Link to="/donos/novo" className="btn btn-primary">+ Cadastrar Novo Dono</Link>
        </div>
      </div>

      {donos.length === 0 ? (
        <p>Nenhum dono cadastrado ainda.</p>
      ) : (
        <ul className="list-group">
          {donos.map((dono) => (
            <li key={dono._id} className="list-group-item">
              <Link
                to={`/donos/${dono._id}`}
                style={{
                  textDecoration: 'none',
                  color: 'inherit',
                  cursor: 'pointer',
                }}
                onMouseEnter={(e) => (e.target.style.textDecoration = 'underline')}
                onMouseLeave={(e) => (e.target.style.textDecoration = 'none')}
              >
                <strong>{dono.nome}</strong>
              </Link>{' '}
              – CPF: {dono.cpf}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
